// Colors
// Global
export const colorWhite = '#FFFFFF';
export const colorBlack = '#000000';

// Primary colors
export const colorMoradul = '#7350FF';
export const colorMoradulLight = '#7F5AFF';
export const colorMoradulDark = '#6645FF';

export const colorMartinique = '#212240';

// Secondary colors
export const colorSelago = '#F8FAFB';
export const colorMontecarlo = '#64ffda';

// Positive
export const colorPositive = colorMartinique;
export const colorPositiveLight = '#717285';
export const colorPositiveLighter = '#A7A7B3';

// Feedback
export const colorFbNegative = '#FC5959';

// Alphas
// Nagatives & shadows
export const alpha16 = '0.16';
export const alpha32 = '0.32';

// Aliases (no more new colors from this line)
export const colorbackground = '#EEEEF0';
export const colorBackgroundHighlight = colorSelago;
export const colorBase = colorMartinique;
export const colorMain = colorMoradul;
export const colorMainLight = colorMoradulLight;
export const colorMainDark = colorMoradulDark;
export const colorFocus = colorMain;

export const colorShadowLight = `rgba(${colorBase}, ${alpha16})`;
export const colorShadowDark = `rgba(${colorBase}, ${alpha32})`;

export const colorPrintmain = '#4C58A7';

// Base 8 padding & margin
export const spacing = '8px';

// Default border-radius
export const radius = '4px';

// Transition speed
export const slow = '2s';
export const fast = '1s';
export const faster = '0.5s';
export const fastest = '0.3s';

// Fonts
export const mainfont = '"Avenir Next", "Avenir", "Segoe UI", sans-serif';
export const secondaryfont = '"Helvetica Neue", Helvetica, Arial, sans-serif';

// Sizes
export const fontSizeXxl = '36px';
export const fontSizeXl = '16px';
export const fontSizeL = '14px';
export const fontSizeM = '13px';
export const fontSizeS = '12px';
export const fontSizeXs = '11px';
export const fontSizeXxs = '8px';

// Weights
export const boldWeight = '700';
export const bookWeight = '400';
export const lightWeight = '300';
